import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Login from './Login';
import UsersList from './UsersList';
import UserDetail from './UserDetail';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  return (
    <Router>
      <Routes>
        <Route path="/" element={!isLoggedIn ? <Login onLoginSuccess={() => setIsLoggedIn(true)} /> : <Navigate replace to="/users" />} />
        <Route path="/users" element={isLoggedIn ? <UsersList /> : <Navigate replace to="/" />} />
        <Route path="/user/:id" element={isLoggedIn ? <UserDetail /> : <Navigate replace to="/" />} />
      </Routes>
    </Router>
  );
}

export default App;
